DROP TABLE IF EXISTS `system_data_scope`;
CREATE TABLE `system_data_scope`  (
  `id` bigint(64) NOT NULL AUTO_INCREMENT,
  `menu_id` bigint(64) NOT NULL COMMENT '关联的菜单',
  `name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '数据权限名',
  `method` varchar(400) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '拦截的方法',
  `scope_type` int(11) NOT NULL DEFAULT 0 COMMENT '数据权限类型：0=全部数据,1=本机构数据,2=本机构及下级机构,3=本人数据4,自定义',
  `scope_sql` varchar(400) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '自定义SQL',
  `creator` bigint(64) NULL DEFAULT NULL COMMENT '创建人',
  `create_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `reviser` bigint(64) NULL DEFAULT NULL COMMENT '修改人',
  `revise_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `deleted` int(11) NULL DEFAULT NULL COMMENT '是否删除',
  `group_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '机构',
  `remark` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
  `role_ids` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关联的角色',
  `no_use` int(2) NOT NULL DEFAULT 0 COMMENT '是否禁用',
  `globalized` int(11) NULL DEFAULT 0 COMMENT '全局生效：1=是，0=否',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

